import React from 'react';
import pentagonImage from './pentagon.png';

const CardWithArrow = () => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
  };

  const arrowStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    height: '100px',
    width: '100px',
    backgroundImage: 'url(arrow.png)',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
  };

  const cardStyle = {
    border: '1px solid #ccc',
    borderRadius: '5px',
    padding: '10px',
    marginBottom: '20px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    position: 'relative',
  };

  return (
    <div style={containerStyle}>
      <div style={arrowStyle}></div>
      <div style={cardStyle}>
        <h3>Card title</h3>
        <p>Card content</p>
      </div>
      <img src={pentagonImage} alt="Pentagon" />
    </div>
  );
}

export default CardWithArrow;
